import React from 'react';

const InformationPage = () => {
  return (
    <div>
      <div className="flex justify-center items-center p-8">
        <BoxWithArrow>Box 1</BoxWithArrow>
        <BoxWithArrow>Box 2</BoxWithArrow>
        <BoxWithArrow>Box 3</BoxWithArrow>
        <BoxWithArrow>Box 4</BoxWithArrow>
      </div>

      <div className="p-8">
        <form>
          {/* Your form elements go here */}
          <label className="block mb-4">
            Name:
            <input className="border p-2" type="text" name="name" />
          </label>
          {/* Add more form elements as needed */}
          <button className="bg-blue-500 text-white px-4 py-2 rounded" type="submit">
            Submit
          </button>
        </form>
      </div>
    </div>
  );
};

// Styles for individual elliptical boxes with arrows
const boxWithArrowStyles = 'flex items-center';

// Styles for individual elliptical boxes
const ellipseBoxStyles =
  'w-20 h-10 rounded-full bg-blue-500 flex justify-center items-center text-white';

// Styles for the arrow container
const arrowContainerStyles = 'relative';

// CSS class for the arrow
const arrowStyles = 'h-2 w-40 bg-blue-500 absolute top-1/2 transform -translate-y-1/2';

// Styles for arrowheads
const arrowheadStyles =
  'absolute w-0 h-0 border-t-4 border-r-4 border-b-4 border-l-4';

// Arrow component
const Arrow = () => (
  <div className={arrowContainerStyles}>
    <div className={arrowStyles}>
      <div className={`${arrowheadStyles} border-r-4 border-blue-500`}></div>
      <div className={`${arrowheadStyles} border-l-4 border-blue-500 right-0`}></div>
    </div>
  </div>
);

// Box component with arrow
const BoxWithArrow = ({ children }) => (
  <div className={boxWithArrowStyles}>
    <div className={ellipseBoxStyles}>{children}</div>
    <Arrow />
  </div>
);

export default InformationPage;
